                        <span><button>Instant Book</button></span>
                        <span><button>More Filters</button></span>
                    </div>
                    {
                        hotelInfo.map(detail => <HotelDetail detail={detail}></HotelDetail>)
                    }
                </div>
                <div className="col-md-6">

                </div>
            </div>
        </div>
    );
};

export default Hotel;
